import React from 'react';
import { Grid, Card, CardContent } from '@material-ui/core';

const FormRegister = props => {
	return(
		<Grid item sm={4}>
			<Card>
				<CardContent>
					Soy agregar
				</CardContent>
			</Card>
		</Grid>
	);
}

export default FormRegister;
